import React from 'react';


export const Stations = (property) =>{


  const listItems = property.map((station)=>
    <div key={station.name}>
      <p>{station.name}</p>

    </div>


);

  return(
    <div>
      {listItems === [] ? listItems : [] }
    </div>

  )
}
